import{_ as o,o as n,c as s,a as e,b as i,w as r,d as t,e as h,r as l}from"./app.7f1fd85c.js";const c={},d=e("h1",{id:"troubleshooting",tabindex:"-1"},[e("a",{class:"header-anchor",href:"#troubleshooting","aria-hidden":"true"},"#"),t(" Troubleshooting")],-1),u={class:"custom-container tip"},p=e("i",{class:"fas fa-info"},null,-1),f=t("Please also use the "),b=t("Frequently asked questions"),y=t(" page."),g=h('<p>If you run into a problem, please check this page first. In the case that you can&#39;t find your problem here, or the steps described here don&#39;t solve your issue, please contact your server&#39;s administrator or <a href="./report-issue">Report it as a bug</a>.</p><h2 id="the-client-does-not-start" tabindex="-1"><a class="header-anchor" href="#the-client-does-not-start" aria-hidden="true">#</a> The client does not start</h2><p>In most of the cases, this is due your used browser&#39;s or operating system&#39;s version being outdated. Please try updating your browser or operating system to the latest version and then try again.</p><p>Although this does not happen frequently, if your client will still not start after this, it is possible for the cache to be at fault.In this case, please try clearing your cache and then try again.</p><h2 id="pages-cannot-be-loaded" tabindex="-1"><a class="header-anchor" href="#pages-cannot-be-loaded" aria-hidden="true">#</a> Pages cannot be loaded</h2><p>If your client does boot, but you get an error when trying to load a page, please check your network connection for errors.In addition, check that the server you are trying to access is not down.</p><p>Although this does not happen frequently, cases where the cache is at fault can happen.In this case, please try clearing your cache and then try again.</p><p>Any remaining problems are likely related to the server you are trying to access, so please contact its administrator.</p><h2 id="the-client-is-slow" tabindex="-1"><a class="header-anchor" href="#the-client-is-slow" aria-hidden="true">#</a> The client is slow</h2><p>Please try the following:</p><ul><li>Activate &quot;Reduce UI animations&quot; in the client settings</li><li>Deactivate &quot;Use blur effect for modals&quot; in the client settings</li><li>Activate hardware acceleration in your browser&#39;s settings</li><li>Upgrade the specs of your used device</li></ul><h2 id="parts-of-the-ui-are-weird-for-example-the-background-is-transparent" tabindex="-1"><a class="header-anchor" href="#parts-of-the-ui-are-weird-for-example-the-background-is-transparent" aria-hidden="true">#</a> Parts of the UI are weird (For example, the background is transparent)</h2><p>Broken UI display may be caused by the theme cache system when the UI is changed as part of an update. Pressing &quot;Clear cache&quot; in the settings will fix this.</p><div class="custom-container warning"><i class="fas fa-exclamation"></i><p>Specifically clear the &quot;Client&#39;s&quot; cache. Don&#39;t clear the &quot;Browser&#39;s&quot; cache.</p></div><h2 id="the-blinking-light-of-a-notification-or-antenna-won-t-go-away" tabindex="-1"><a class="header-anchor" href="#the-blinking-light-of-a-notification-or-antenna-won-t-go-away" aria-hidden="true">#</a> The blinking light of a notification or Antenna won&#39;t go away</h2><p>A blinking light indicates unread content.In cases where this light won&#39;t go away, there is usually unread content that has been pushed away by new incoming content. If you believe to have read all content, but the light still won&#39;t go away (likely a bug), you can forcibly mark all content as read via the user settings.</p><h2 id="the-renote-button-is-blocked-out" tabindex="-1"><a class="header-anchor" href="#the-renote-button-is-blocked-out" aria-hidden="true">#</a> The renote button is blocked out</h2><p>Followers-only notes cannot be renoted.</p><h2 id="specific-parts-of-the-misskey-web-ui-are-not-being-displayed" tabindex="-1"><a class="header-anchor" href="#specific-parts-of-the-misskey-web-ui-are-not-being-displayed" aria-hidden="true">#</a> Specific parts of the Misskey Web UI are not being displayed</h2><p>Problems like these can arise if you are using an Adblocker. For an optimized experience on Misskey, please turn it off.</p><h2 id="some-parts-of-the-misskey-web-ui-are-untranslated" tabindex="-1"><a class="header-anchor" href="#some-parts-of-the-misskey-web-ui-are-untranslated" aria-hidden="true">#</a> Some parts of the Misskey Web UI are untranslated</h2><p>In most cases, this is simply a matter of the translation not having been done yet instead of being a bug.Please wait until the translation of this area has been completed. You can alternatively also <a href="./misskey">participate in translation</a> yourself.</p>',22);function m(w,k){const a=l("RouterLink");return n(),s("div",null,[d,e("div",u,[p,e("p",null,[f,i(a,{to:"/zh-CN/docs/faq.html"},{default:r(()=>[b]),_:1}),y])]),g])}var v=o(c,[["render",m],["__file","troubleshooting.html.vue"]]);export{v as default};
